const userAuthReducer=(state=null,action)=>{
    switch(action.type){
    case 'SET_USER':
    return{
        ...state,
        user : action.user
    };
    case 'SET_USER_NULL':
    return{
        ...state,
        user : null,
    };
    default:
        return state;
};
}
export default userAuthReducer;
